import React from 'react';

function Footer() {
  return (
    <div className='foter'>
      <div className='info'>
        <span className='spans'>Telefono</span>
        <span className='spans'>Instagran</span>
        <span className='spans'>Correo</span>
      </div>
      <div>
        <span className='copy'>Copyright</span>
      </div>
    </div>
  )
}

export default Footer
